import React from "react";
import './MainImage.css';

function MainImage() {
  return(
    <React.Fragment>
        <div className="container h-90 bgimage">
            <div className="row">
                <div className="col">
                    <h3>This is heading</h3>
                    <p>This is text</p>
                </div>
            </div>
        </div>
   </React.Fragment>
  )
}

export default MainImage;
